function rel2anotherRel($rel) {
    var customizer = function (x, y) {
        if (_.isArray(x)) {
            return _.uniq(x.concat(y));
        }
        else {
            return undefined;
        }
    };
    var ff = function (r) {
        return {
            agent: r.agent,
            relation: ["(" + r.from + "," + r.to + ")"]
        };
    };
    var bundleRel = function (x) {
        var gg = function (z, w) { return _.mergeWith(z, w, customizer); };
        return _.reduce(x, gg, {});
    };
    return _.chain($rel)
        .map(ff)
        .groupBy('agent')
        .sortBy('agent')
        .map(bundleRel)
        .value();
}
